import React from "react";
import Routes from './Routes';
import FooterComponent from './core/FooterComponent/FooterComponent';
import HeaderComponent from './core/HeaderComponent/HeaderComponent'

const App = () => {
    return (
        <>
          <HeaderComponent/>
          <Routes/>
          <FooterComponent/>
        </>
    )
};

export default App;
